import React, { useState } from "react";
import { registerUserAction } from "../ducks/user";
import { Button } from "primereact/button";
import { useDispatch } from "react-redux";
import { push } from "connected-react-router";
import { Card } from "primereact/card";
import { InputText } from "primereact/inputtext";

export function Register() {
  const dispatch = useDispatch();

  function handleRegisterUserInfo() {
    dispatch(registerUserAction(userInfo));
    dispatch(push("/"));
  }

  const [userInfo, setUserInfo] = useState({
    email: "",
    password: "",
  });

  return (
    <div className="registerPage">
      <h3>Register an account</h3>
      <Card className="userCard">
        <div className="registerForm">
          <label className="registerLabel">E-mail</label>
          <br />
          <InputText
            onChange={(event) => {
              setUserInfo({ ...userInfo, username: event.target.value });
            }}
            type="text"
          />
          <br /> <br />
          <label className="registerLabel">Password</label>
          <br />
          <InputText
            onChange={(event) => {
              setUserInfo({ ...userInfo, password: event.target.value });
            }}
            type="password"
          />
          <br /> <br />
          <label className="registerLabel">Repeat password</label>
          <br />
          <InputText
            onChange={(event) => {
              setUserInfo({ ...userInfo, password: event.target.value });
            }}
            type="password"
          />
          <br /> <br /> <br />
          <div className="submitBtn">
            <Button
              className="p-button-info p-button-raised"
              onClick={handleRegisterUserInfo}
            >
              Create account
            </Button>
          </div>
        </div>
      </Card>
    </div>
  );
}

export default Register;
